                  <th colSpan="6">
                    <b>Ticket Number</b>
                  </th>
                  <th colSpan="2">
                    <b>Closed Date</b>
                  </th>
                  <th>
                    <b>Rating</b>
                  </th>
                  <th colSpan="6">
                    <b>Comment</b>
